(202, 'Woraphon choaywong', 'phoori12@gmail.com', 'สวัสดีครับ ผมสมัครทัวร์ dota2 ของมอพระจอมเกล้าพระนครเหนือครับ ทีมชื่อ BeeHurn มีชื่อทีมในหน้าเพจแต่พอกดไปดูละไม่ขึ้นชื่อผู้เล่นเลยครับ ไม่ทราบว่ามีอะไรผิดพลาดรึป่าวครับ', '2020-01-11 17:04:55');
