INSERT INTO `tournaments` (`tour_id`, `tour_name`, `tour_date_start`, `tour_date_stop`, `tour_time`, `tour_prizepool`, `tour_info`, `tour_rules`, `tour_bracket`, `tour_prizepool_detail`, `tour_status`, `tour_picdir`, `tour_pic`) VALUES
(1, 'LOL', '2020-09-22', '2020-10-12', '19.00 - 21.00', '10,000', '<p><strong>เปิดรับสมัครการแข่งขันวันที่ 22 - 1 ตุลาคม 2563 ภายในมหาลัยราชมงคลธัญบุรีเท่านั้น</strong></p>\r\n\r\n<p>Discord ใช้สำหรับการแข่งขันแลบะติดต่อสอบถามรายละเอียดได้ที่&nbsp;<a href=\"https://discord.gg/eWKQwXu\">JOIN</a><br />\r\n<a href=\"https://discord.gg/eWKQwXu\" target=\"_blank\">https://discord.gg/eWKQwXu</a></p>\r\n\r\n<p><strong>ประกาศสายการแข่งขันวันที่ 7 ตุลาคม 2563</strong></p>\r\n\r\n<p><strong>รูปแบบการแข่งขัน </strong><strong>Valorant Excellence Tour 2020</strong></p>\r\n\r\n<p>Maps Qualifier : รอประกาศ (Bo1)<br />\r\nRound of 32 : รอประกาศ (Bo1)<br />\r\nRound of 16 : รอประกาศ (Bo1)</p>\r\n\r\n<p>Round of&nbsp; 8 : รอประกาศ (Bo1)<br />\r\nSemi finals : Pick &amp; ban (Bo3)&nbsp;<br />\r\nGrand Finals : Pick &amp; ban (Bo5) (มีถ่ายทอดสด Live)</p>\r\n\r\n<p><strong>รูปแบบการแข่งขัน</strong>&nbsp;: Single Elimination : Best of 1<br />\r\n<strong>ระบบการแข่งขัน</strong>&nbsp;: 5 vs 5</p>\r\n\r\n<p>เวลากลางในการแข่งขันในกรณีตกลงกันไม่ได้&nbsp;: 19.00น.</p>\r\n\r\n<p><em><strong>แผนที่ที่ใช้แข่ง</strong></em></p>\r\n\r\n<p>- Ascent<br />\r\n- Blind<br />\r\n- Split<br />\r\n- Haven</p>\r\n\r\n<h3>&nbsp;</h3>\r\n', '<p><strong>Rules</strong></p>\r\n\r\n<hr />\r\n<p><strong>รายละเอียดทัวร์นาเมนต์</strong></p>\r\n\r\n<p>Valorant Excellence Tour 2020 ต่อเนื่องกับครั้งแรกกับการแข่งขันเกม Valorant ในมหาลัยมหาลัยราชมงคลธัญบุรี&nbsp;ชิงเงินรางวัลรวม 10,000 บาท</p>\r\n\r\n<p>ด้วยการสนับสนุนจาก Beyond Godlike&nbsp; พร้อมเปิดกันในสนามประลองให้ทุกทีมเข้ามาชิงชัยกัน</p>\r\n\r\n<p>เปิดรับสมัครการแข่งขันวันที่ 22&nbsp;- 1 ตุลาคม 2563 ภายในมหาลัยราชมงคลธัญบุรี</p>\r\n\r\n<p>ประกาศสายการแข่งขันวันที่ 7 ตุลาคม 2563</p>\r\n\r\n<p>ติดตามข้อมูลข่าวสารเพิ่มเติมได้ที่เฟสบุ๊คเพจ&nbsp;Beyond&nbsp;Godlike</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>กติกาก่อนทำการแข่งขัน </strong><strong>Valorant Excellence Tour 2020</strong></p>\r\n\r\n<p>● โหมดการแข่งขัน : มาตรฐาน<br />\r\n● กลโกง: ปิด<br />\r\n● Version ที่ใช้แข่งขัน : Patch ปัจจุบัน</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>การแจ้งผลชนะหรือชนะบาย</strong></p>\r\n\r\n<p>● ให้แจ้งผลการแข่งขันผ่าน Discord ในห้องที่ทางทีมงานได้กำหนดไว้&nbsp;</p>\r\n\r\n<p>● ห้ามมาเกินเวลาที่กำหนดไว้ เกิน 15 นาที กรุณามาให้ตรงเวลาแข่ง (ถ้ามาช้าปรับแพ้บาย)</p>\r\n\r\n<p>● ในกรณีรอบลึกๆ ถ้าหากทีมแข่งที่จะเจอกับคุณยังแข่งไม่เสร็จกรุณารอจนกว่าจะได้ผู้ชนะถึงจะแข่งต่อได้</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;<strong>กติการะหว่างทำการแข่งขัน</strong></p>\r\n\r\n<p>● สำหรับ Streamer ที่ Stream ระหว่างการแข่งขัน ห้ามเปิด Option แสดงเลือด หรือ (Show Blood)&nbsp;จากกฏข้อห้ามของ Riot Games Inc. ควรปฏิบัติตามอย่างเคร่งครัด<br />\r\n● หากผู้เข้าแข่งขันเกิดปัญหาทางเทคนิคหรือเหตุจำเป็น ขณะเริ่มเกม ยังไม่มี Score Kill หรือ Win ให้ทำการเริ่มเกมใหม่ได้ 1 ครั้ง<br />\r\n● การกดเริ่มเกมได้ต่อเมื่อทั้งสองทีมพร้อม<br />\r\n● เนื่องจากตัวเกมไม่มีระบบ หยุดเกม หรือ Pause Game ถ้าหากมีการหลุดออกจากให้รีบ Reconnect กลับเข้ามาโดยด่วน ฉนั้น ผู้เข้าแข่งขัน ควรตรวจสอบ Internet ระบบไฟฟ้า ของตัวท่านเองด้วย ก่อนเข้าเริ่มทำการแข่งขัน หรือเกิดเหตุการณ์ไม่คาดคิดจากระบบของตัวเกม เนื่องจากเกมเพิ่งเปิดตัวได้ไม่นาน อาจจะมี บัค หรือ ปัญหาบางอย่าง กรุณาเตรียมตัวให้พร้อม</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>กฎระเบียบในการแข่งขัน</strong></p>\r\n\r\n<p>● การตั้งชื่อไม่สุภาพ ไม่สามารถลงแข่ง Tournament ได้<br />\r\n● การเยาะเย้ย ถากถาง ไม่สุภาพ ทั้งวาจาและการกระทำ ต่อทีมเข้าแข่งขัน: ปรับแพ้ทันที</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>หมายเหตุ</strong></p>\r\n\r\n<p>● กฏกติกาอาจจะมีการเปลี่ยนแปลงไปตามความเหมาะสมของสถานการณ์ในระหว่างการแข่งขัน โดยที่อาจจะไม่ได้แจ้งให้ทราบล่วงหน้า แต่จะมีการชี้แจงหน้าเพจหลักทันทีที่มีการเปลี่ยนแปลง<br />\r\n● ทีมที่เข้าร่วมแข่งขันต้องเข้าใจถึงกฏ กติกาอย่างชัดเจน ถ้าเกิดมีการทำผิดกฏ กรรมการสามารถตัดสิทธิ์ทีมนั้นๆ ได้ทันที<br />\r\n● ทางทีมงานจะขออนุญาตทำการ Streaming จากคู่ที่ทีมงานคัดเลือกมา ตามความเหมาะสมในรอบนั้นๆ</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '<p><strong>Prize pool</strong></p>\r\n\r\n<p>Valorant Excellence Tour 2020 &ndash; เงินรางวัลรวม 10,000 บาท</p>\r\n\r\n<p>รางวัลชนะเลิศ 1 &ndash; 5,000 บาท + เสื้อ</p>\r\n\r\n<p>รางวัลรองชนะเลิศ 2 &ndash; 3,000 บาท&nbsp;</p>\r\n\r\n<p>รางวัลรองชนะเลิศ 3&nbsp; &ndash; 2000 บาท</p>\r\n\r\n<p>&nbsp;</p>\r\n', 0, 'pic/upload/2020/09', '1601006561.jpg');
